CREATE TABLE `questions` (
  `qstn_id` int(5) NOT NULL AUTO_INCREMENT,
  `qstn_titl` varchar(3000) NOT NULL,
  `qstn_desc` varchar(20000) NOT NULL,
  `qstn_status` char(1) NOT NULL,
  `topic_id` int(5) NOT NULL,
  `up_votes` int(11) NOT NULL DEFAULT '0',
  `down_votes` int(11) NOT NULL DEFAULT '0',
  `posted_by` varchar(50) NOT NULL,
  `created_ts` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `last_updt_ts` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `views` bigint(20) NOT NULL DEFAULT '0',
  PRIMARY KEY (`qstn_id`),
  KEY `topic_id` (`topic_id`),
  KEY `fk_qstn_userid` (`posted_by`),
  FULLTEXT KEY `fulltxt_index` (`qstn_titl`,`qstn_desc`),
  CONSTRAINT `fk_qstn_userid` FOREIGN KEY (`posted_by`) REFERENCES `users` (`user_id`) ON UPDATE CASCADE,
  CONSTRAINT `fk_topic` FOREIGN KEY (`topic_id`) REFERENCES `topics` (`topic_id`)
) ENGINE=InnoDB AUTO_INCREMENT=70 DEFAULT CHARSET=latin1;
